import { Component } from '@angular/core';
import { Router } from '@angular/router';

@Component({
  selector: 'app-lessons',
  templateUrl: './lessons.component.html',
  styleUrls: ['./lessons.component.css'],
})
export class LessonsComponent {

  constructor(private router: Router){


  }

  showFiller = false;

  loadchapters(){
    this.router.navigate(['members','lessons','chapters']);
  }
}
<mat-drawer-container class="example-container" style="margin-top: 1%;" autosize>
    <mat-drawer #drawer class="example-sidenav" mode="side">
      <p>Auto-resizing sidenav</p>

        <button (click)="loadchapters()">load chapter</button>

    </mat-drawer>

    <div class="example-sidenav-content">
        <mat-icon aria-hidden="false" aria-label="Example menu icon" 
        fontIcon="menu" (click)="drawer.toggle();">

        </mat-icon>
        <router-outlet></router-outlet>
      <button type="button" class="btn btn-custom-success btn-lg px-4 me-md-2" mat-button (click)="drawer.toggle();">
        click to navigate to lessons

      </button>
    </div>


  </mat-drawer-container>
